def car_race_collision(n: int):
    # Initialize collision count to zero
    collisions = 0

    # Iterate through all possible pairs of cars
    for i in range(1, n + 1):
        for j in range(i + 1, n + 1):
            # Check if there is a collision between the two cars
            if i != j:
                collisions += 1

    return collisions

