def fib4(n: int) -> int:
    if n == 0 or n == 1:
        return 0
    elif n == 2:
        return 2
    else:
        # Calculate the sum of the first four terms of the sequence
        return fib4(n - 1) + fib4(n - 2) + fib4(n - 3) + fib4(n - 4)

